const HomePage = () => {
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "red",
        display: "flex",
        flexDirection: "column",
      }}
    >
      <div style={{ flex: 2, display: "flex" }}>
        <div style={{ flex: 5, display: "flex" }}>
          <div style={{ flex: 3.3, background: "green" }}>div_1</div>
          <div style={{ flex: 3.3, background: "white" }}>div_2</div>
          <div style={{ flex: 3.3, background: "green" }}>div_3</div>
        </div>
        <div style={{ flex: 4, background: "white" }}></div>
      </div>
      <div
        style={{
          flex: 8,
          background: "gray",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <div style={{ height: "98%", width: "99%", background: "white" }}></div>
      </div>
    </div>
  );
};

export default HomePage;
